import Button from '../button';
import Field from '../formField';
import Select from '../formSelect';
import buttonImage from "../../assets/images/Summer/Ícones/pngs/local_activity.png";
import './form.css'
import { useState } from 'react';

function Form() {

  const [formData, setFormData] = useState({
    name: '',
    email: '',
    cpf: '',
    ticket: '',
    birthDate: ''
  }); 

  function showData(event) {
    event.preventDefault();
    const name = document.getElementById('name').value;
    const email = document.getElementById('email').value;
    const cpf = document.getElementById('cpf').value;
    const ticket = document.getElementById('ticket').value;
    const birthDate = document.getElementById('birthDate').value;
    const data = {
      name,
      email,
      cpf,
      ticket,
      birthDate,
    };
    console.log(data);
  }

  return (
    <div className="form__container">
        <h1 className="form__title">Preencha o formulário a seguir:</h1>
        <form className="form__body" method="post" action={showData}> 
            <Field labelName={"Nome Completo:"} type={"text"} name={"name"}/>            
            <Field labelName={"Email:"} type={"text"} name={"email"}/>
            <Field labelName={"CPF:"} type={"text"} name={"cpf"}/>
                <div className='form__last__line'>
                    <Select labelName={"Tipo de ingresso"} name={"ticket"}/>
                    <Field labelName={"Data de nascimento:"} type={"date"}/>
                </div>
            <Button text={"Avançar!"} image={buttonImage}/>
        </form>
    </div>
  ) 
    
}

export default Form;
